import { Form, FormControl, FormGroup, FormLabel } from 'react-bootstrap';

const GetAnyJobs = () => {
  return (
    <div className="div-center">
      <Form>
        <FormGroup>
          <FormLabel>Position</FormLabel>
          <FormControl type="text"></FormControl>
        </FormGroup>
      </Form>
    </div>
  );
};

export default GetAnyJobs;
